import React from 'react';
import background from '../assets/background.jpg'

const Search = () => {
    return (
        <div>
            <div style={{
                backgroundImage: `url(${background}) no repeat center center`,
                height: '600px',
                backgroundSize: 'cover',
                borderRadius: '25px'
            }}>

            </div>
        </div>
    );
};

export default Search;
